import React, {useRef} from "react";

const useRefExample = ({primaryPic, secondaryPic}) => {
  const imageRef = useRef(null);
  return (
    <div>
      <img
        onMouseOver={() => {
          imageRef.current.src = primaryPic;
        }}
        onMouseOut={() => {
          imageRef.current.src = secondaryPic;
        }}
        src={primaryPic}
        alt=""
        ref={imageRef}
      />
    </div>
  );
};

export default useRefExample;
